/**
 * @param {number[]} arr
 * @param {number} m
 * @return {number}
 */
var findLatestStep = function (arr, m) {
  let len = arr.length
  let str = Array(len).fill('0'),
    resind = -1
  for (let i = len - 1; i >= 0; i--) {
    let ind = arr[i] - 1;
    str[ind] = '1'
    let list = str.join('').split('0');
    let f = list.some(item => {
      return item.length === m
    })
    if (f) {
      resind = i
      break
    }
  }
  console.log(resind)
  return resind
};

